def injetar_dependencias(handler, dependencias):
    parametros = inspect.signature(handler).parameters
    deps = {
        nome: dependencia
        for nome, dependencia in dependencias.items()
        if nome in parametros
    }
    async def runner(message):
        return await handler(message, **deps)
    return runner

