def rot_custom(string: str, n: int) -> str:
    result = ""
    for char in string:
        if char.isalpha():
            if char.isupper():
                result += chr((ord(char) - 65 + n) % 26 + 65)
            else:
                result += chr((ord(char) - 97 + n) % 26 + 97)
        else:
            result += char

